declare const SQL_QUERY = "\nINSERT INTO Vote (\n  \"method\", \"party\", \"issued\", \"returned\", \"counted\", \"personId\", \"electionId\"\n) VALUES (\n  @method, @party, @issued, @returned, @counted, @personId, @electionId\n)\nON CONFLICT (\"personId\", \"electionId\") DO UPDATE SET\n\"method\" = IFNULL(@method, \"method\"), \"party\" = IFNULL(@party, \"party\"), \"issued\" = IFNULL(@issued, \"issued\"), \"returned\" = IFNULL(@returned, \"returned\"), \"counted\" = IFNULL(@counted, \"counted\")\n";
export default SQL_QUERY;
